import React from 'react';
import { Card, CardContent, Typography, Grid } from '@material-ui/core';
import CountUp from 'react-countup';
import cx from 'classnames';

const Cards = ({ data: { confirmed, recovered, deaths, lastUpdate } }) => {
    //console.log(confirmed);
    if (!confirmed) {
        return ('loadding...');
    }

    return (

        <div className="app">
            <Grid container spacing={3} justify="center">

                <Grid item component={Card}>
                    <CardContent>
                        <Typography color="textSecondary" gutterBottom>Infecterd</Typography>
                        <Typography varaint="h5" gutterBottom>
                            <CountUp
                            start={0}
                            duration={2.5}
                            separator=","
                            />
                            {confirmed.value}</Typography>
                        <Typography color="textSecondary" gutterBottom>Real Date</Typography>
                        <Typography varaint="body2" gutterBottom>Number of active cases of COVID-19</Typography>
                    </CardContent>
                </Grid>
                <Grid item component={Card}>
                    <CardContent>
                        <Typography color="textSecondary" gutterBottom>Recovered</Typography>
                        <Typography varaint="h5" gutterBottom>Real Data</Typography>
                        <Typography color="textSecondary" gutterBottom>Real Date</Typography>
                        <Typography varaint="body2" gutterBottom>Number of recoveries COVID-19</Typography>
                    </CardContent>
                </Grid>
                <Grid item component={Card}>
                    <CardContent>
                        <Typography color="textSecondary" gutterBottom>Deaths</Typography>
                        <Typography varaint="h5" gutterBottom>Real Data</Typography>
                        <Typography color="textSecondary" gutterBottom>Real Date</Typography>
                        <Typography varaint="body2" gutterBottom>Number of Deaths caused COVID-19</Typography>
                    </CardContent>
                </Grid>


            </Grid>
        </div>
    )
}

export default Cards;
